                  id="field18">
                  <option>{props.t("yes")}</option>
                  <option>{props.t("No")}</option>
                </AvField>
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field50">{props.t("Amount")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field50"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field19">{props.t("Comision FID Auto Banesco")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field19"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field20">{props.t("ITBMS FID")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field20"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>
          </Row>
          <Row>

            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field50">{props.t("Letra Total incluye comision Fiduciaria")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field50"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field19">{props.t("COMERCARFIDBANE")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field19"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>

          </Row>

          <Row>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field18">{props.t("MonthlyBil")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field18"
                  type="select"
                  validation={{ required: true }}
                  id="field18">
                  <option>{props.t("yes")}</option>
                  <option>{props.t("No")}</option>
                </AvField>
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field50">{props.t("Amount")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field50"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="commissionFwla">{props.t("CommissionFWLA")}</Label>
                <AvField
                  className="form-control"
                  name="commissionFwla"
                  id="commissionFwla"
                  type="text"
                  validation={{ required: true }}
                  value={props.DataGeneral?.commissionFwla ?? ''} />
              </div>
            </Col>
            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="field50">{props.t("USD")}</Label>                               {/**NoItem*/}
                <AvField
                  className="form-control"
                  name="field50"
                  type="text"
                  validation={{ required: true }}
                  value="" />
              </div>
            </Col>


            <Col md="3">
              <div className="mb-3">
                <Label htmlFor="interestPaymentCycle">{props.t("InterestPaymentCycle")}</Label>
                <AvField
                  className="form-control"
                  name="interestPaymentCycle"
                  type="select"
                  validation={{ required: true }}
                  id="interestPaymentCycle">
                  <option>{props.t("Monthly")}</option>
